import { EffectDiv } from "../../styleTemplates.js"

export const StartBtn = () => {
  return (
    <EffectDiv>
      <h4>Start!</h4>
    </EffectDiv>
  );
};

export const AccountBtn = () => {
  return (
    <EffectDiv>
      <h4 style={{ fontSize: "1.2rem" }}> 회원가입/로그인 </h4>
    </EffectDiv>
  );
};
